import React, { Component } from 'react';
import logo from '../../assets/images/logo.png';

class Login extends Component {
  render() {
    return (
      <div>
        <img src={ logo } className="App-logo" alt="logo" />
        <p>
          SUA VEZ
        </p>
        <h1>Login</h1>
      </div>

    );
  }
}

export default Login;
